# STEP 1 GET FILES

def directory_input(directory_name):
  files_in_directory = []
  for filename in os.listdir(directory_name):
    file = os.path.join(directory_name, filename)
    if os.path.isfile(file):
        files_in_directory.append(file)
  return files_in_directory

directory_input(DIRECTORY1_NAME)

# STEP 2 GET TEXT AND PARSE

def extract_doc_text(document_name):
  with open(document_name, errors="ignore") as fp:
    raw_text = fp.read()
    # print(raw_text)

    raw_text = raw_text[raw_text.find("<!DOCTYPE"):]

    soup = BeautifulSoup(raw_text, 'html.parser')
    for script in soup(["script", "style"]):
      script.extract()
    text = soup.get_text()
    return text

