"""# TASK 4: Keeping additional Information
As required in previous step, each document should have a unique integer docID be. docID should be assigned to the
document at the time of preprocessing. You will also need to store document length which will be used in next
assignment (Ranked retrieval).
Keep a separate file that maps sub_directory/documentName to docID and its document length, named docInfo.txt.
Format of this file should be as follow.
docID,sub_directory/documentName,documentLength,magnitudeofDocument.
Not that magnitude and length are two different things. Magnitude is used in cosine similarity formula (|V(D)|) and
length is BM25 (length d) 
"""

def make_docs_file(filename, docId):
  fp = open("docInfo.txt", "a")
  file_stats = os.stat(filename)
  docs_message = str(docId) + "," + filename + "," + str(file_stats.st_size) + "\n"
  fp.write(docs_message)

