# CREATING INDEX OF TERMS AND DOCIDS

def add_to_terms_index(terms_index, dictionary):
  terms_index = {}
  for key in dictionary:
    for t in dictionary[key]:
      if t in terms_index:
        docIds = terms_index[t]
        if key not in docIds:
          docIds.append(key)
          terms_index[t] = docIds
      else:
        docIds = [key]
        terms_index[t] = docIds    
  return terms_index

def create_terms_index_list(dictionary):
  terms_index = {}
  terms_index = add_to_terms_index(terms_index, dictionary)
  return terms_index


