  if position_in_file is '':
    return None
  fp.seek(int(position_in_file))
  print("position in file is ", int(position_in_file))
  posting_list = []
  document_frequency = int(read_word_from_file(fp))
  posting_list.append(document_frequency)
  for x in range(0, document_frequency):
    docId = int(read_word_from_file(fp))
    posting_list.append(docId)
    term_frequency_in_doc = int(read_word_from_file(fp))
    posting_list.append(term_frequency_in_doc)
    for y in range(0, term_frequency_in_doc):
      posting_list.append(int(read_word_from_file(fp)))
  print("the returnable posting list is ", posting_list)
  return posting_list

